    <style>
    body { margin: 0; padding: 0; }
    
    /* El mapa ocupa toda la pantalla de fondo */
    .folium-map { 
        position: absolute !important; 
        top: 0 !important; bottom: 0 !important; left: 0 !important; 
        width: 100% !important; height: 100vh !important; 
        transition: left 0.3s ease, width 0.3s ease;
        z-index: 1;
    }

    /* En escritorio, desplazamos el mapa cuando el men√∫ est√° visible */
    @media (min-width: 992px) {
        body:not(.sidebar-plegada-activa) .folium-map { 
            left: 320px !important; 
            width: calc(100% - 320px) !important; 
        }
    }

    .leaflet-control-layers { 
        position: fixed !important; top: 0 !important; left: 0 !important; 
        width: 320px !important; height: 100vh !important; margin: 0 !important; 
        padding: 25px !important; background-color: #1E5F91 !important; color: white !important; 
        border: none !important; border-radius: 0 !important; z-index: 1000 !important; overflow-y: auto !important; 
        transition: transform 0.3s ease-in-out;
    }
    
    .sidebar-plegada { transform: translateX(-100%); }
    
    #toggle-sidebar {
        position: fixed; top: 10px; left: 330px; z-index: 2000;
        background: #1E5F91; color: white; border: 2px solid #FFD700;
        padding: 10px; cursor: pointer; border-radius: 5px; transition: left 0.3s;
        font-family: Arial, sans-serif; font-weight: bold;
    }
    .boton-plegado { left: 10px !important; }

    .seccion-contenedor { margin-bottom: 10px; border-bottom: 1px solid rgba(255,255,255,0.1); padding-bottom: 5px; }
    .seccion-header { display: flex; align-items: center; justify-content: space-between; background: rgba(0,0,0,0.3); padding: 8px; cursor: pointer; border-left: 4px solid #FFD700; }
    .seccion-titulo-texto { font-weight: bold; color: #FFD700; font-size: 11px; text-transform: uppercase; flex-grow: 1; margin-left: 10px; }
    .checkbox-maestro { transform: scale(1.2); cursor: pointer; }
    .flecha { font-size: 10px; transition: transform 0.3s; margin-right: 5px; }
    .colapsado .flecha { transform: rotate(-90deg); }
    .grupo-contenido { padding-left: 10px; margin-top: 5px; }
    .grupo-contenido.oculto { display: none; }
    .leaflet-control-layers-overlays label { color: white !important; margin-bottom: 3px !important; display: block !important; cursor: pointer; font-size: 11px !important; }
</style>

    <div id="toggle-sidebar" onclick="toggleSidebar()">Plegar Men√∫</div>
    
<script>
    function toggleSidebar() {
        var sidebar = document.querySelector('.leaflet-control-layers');
        var boton = document.getElementById('toggle-sidebar');
        var body = document.querySelector('body');
        
        // Alternar clases para activar animaciones
        sidebar.classList.toggle('sidebar-plegada');
        boton.classList.toggle('boton-plegado');
        body.classList.toggle('sidebar-plegada-activa');
        
        boton.innerText = sidebar.classList.contains('sidebar-plegada') ? 'Ver Men√∫' : 'Plegar Men√∫';
        
        // ¬°ESTO ES LO M√ÅS IMPORTANTE! 
        // Obliga al mapa a redimensionarse despu√©s de la animaci√≥n para quitar el fondo gris
        setTimeout(function(){ 
            window.dispatchEvent(new Event('resize')); 
        }, 310);
    }

    document.addEventListener("DOMContentLoaded", function() {
        var layersControl = document.querySelector('.leaflet-control-layers-overlays');
        var labels = Array.from(layersControl.querySelectorAll('label'));
        
        layersControl.innerHTML = '<div style="text-align: center; border-bottom: 2px solid white; margin-bottom: 20px; padding-bottom:10px;">' +
                                  '<h3 style="margin:0; font-size:16px;">Modalidad Motochorros</h3>' +
                                  '<h4 style="margin:5px 0 0 0; font-size:12px; opacity:0.8;">MDP - SSRAII</h4></div>';

        function crearCategoria(filtros, nombreVisible, esDesplegable) {
            var contenedor = document.createElement('div');
            contenedor.className = 'seccion-contenedor' + (esDesplegable ? ' colapsado' : '');
            var header = document.createElement('div');
            header.className = 'seccion-header';
            var chkPadre = document.createElement('input');
            chkPadre.type = 'checkbox';
            chkPadre.className = 'checkbox-maestro';
            var titulo = document.createElement('div');
            titulo.className = 'seccion-titulo-texto';
            titulo.innerText = nombreVisible;
            var flecha = document.createElement('span');
            flecha.className = 'flecha';
            flecha.innerText = '‚ñº';

            header.appendChild(chkPadre);
            header.appendChild(titulo);
            if(esDesplegable) header.appendChild(flecha);
            
            var cuerpo = document.createElement('div');
            cuerpo.className = 'grupo-contenido' + (esDesplegable ? ' oculto' : '');
            
            var items = labels.filter(l => filtros.some(f => l.innerText.includes(f)));
            items.forEach(l => cuerpo.appendChild(l));

            if(items.length > 0) {
                layersControl.appendChild(contenedor);
                contenedor.appendChild(header);
                contenedor.appendChild(cuerpo);

                titulo.onclick = function() {
                    if(esDesplegable) {
                        cuerpo.classList.toggle('oculto');
                        contenedor.classList.toggle('colapsado');
                    }
                };
                
                chkPadre.onchange = function() {
                    var estado = this.checked;
                    cuerpo.querySelectorAll('input').forEach(c => { if(c.checked !== estado) c.click(); });
                };
            }
        }

        crearCategoria(["üî¥"], "Desde 20-12-2025 al 05-01-26", true);
        crearCategoria(["üîµ"], "Desde el 10-01-26 a la fecha", true);
        crearCategoria(["üü¢"], "Delitos por 911", true);
        crearCategoria(["üî≤", "üõ°Ô∏è"], "Despliegue de Recursos", false);
        crearCategoria(["üüß"], "Shapefiles / An√°lisis", false);
        crearCategoria(["‚ö™"], "Comparativa", true);
        crearCategoria(["üíé"], "Delitos Prevenibles 911", true);

    });
</script>

 llevaba una billetera negra con tarjetas de Mercado Pago, Uala y una perteneciente al Banco provincia, de la cual remarca que no se trata de la cuenta sueldo y dinero en efectivo no pudiendo precisar la cantidad, ademas de la chomba de color azul con cuello turquesa perteneciente al operativo, una bermuda de fajina azul, un chaleco refractario de Policia, una pistolera y un par de medias blancas. Ademas llevaba consigo una matera y una bolsa de tela con vestimenta particular. Cuando el sujeto se le acerca comienza a tironearle desde el bolso gris marca nike, arrastrandola por el asfalto logrando quitarselo para posteriormente salir corriendo con el otro sujeto que se quedo esperando en la mano de enfrente en el motovehiculo en el cual se movilizaban. Luego de esto la misma se comunica con su progenitora Rodriguez Karina informandole lo ocurrido, la cual en comunicacion telefonica con el Comisario Molina Ricardo, director de Escuela Juan Vucetich sede Mar del Plata anoticiandolo del ilicito sufrido por la dicente"                 </div>             </div>         </div>         </div>`)[0];

                var html_d366fdf66b1f08db9c60dab933a139a9 = $(`<div id="html_d366fdf66b1f08db9c60dab933a139a9" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-01-23 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>21:30:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>MAIPU 3455</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO</td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "En la Localidad de Mar del Plata, Partido de General Pueyrredon, Provincia de Buenos Aires, Republica Argentina, en el asiento de la Seccional 4ta. del Partido de General Pueyrredon, a los 23 dias del mes de Enero del a√±o 2026, siendo las 23:00 comparece ante la instruccion, una persona con deseos de formular una denuncia de indole penal. Impuesta de las penas con que la ley castiga a los que denuncian falsamente (Articulo 245 del Codigo Penal de la Nacion), cuyo texto reza ‚ÄúSe impondra prision de 2 meses a 1 a√±o o multa de $750 a $12500 al que denunciare falsamente un delito ante la autoridad‚Äù, y del que se procede a dar lectura. Seguidamente en este estado el compareciente es preguntado para que diga en este acto segun sus creencias o convicciones civicas mediante la formula  ÃàLO JURO Ãà o  ÃàLO PROMETO Ãà (Articulo 100 C.P.P.) a decir verdad en todos sus dichos y en lo que le fuere preguntado, a lo que dice que JURA decir verdad. Preguntado por sus circunstancias personales dijo ser y llamarse HERNANDEZ LUIS ARMANDO, de nacionalidad argentina, de estado civil casado, instruido, de ocupacion independiente, de 64 a√±os de edad, nacido el 14/10/1961 en la ciudad de San Rafael Provincia de Mendoza, titular del DNI: 14.435.881, domiciliado en calle Maipu nro. 4355 de la ciudad de Mar del Plata Provincia de Buenos Aires, telefono 2235987806, correo electronico instalacionesobras@gmail.com. Seguidamente se le hace saber lo normado en el |articulo 288 del C.P.P. Prohibicion de denunciar. Responsabilidad. - Nadie podra denunciar a su conyuge, ascendiente, descendiente o hermano, a menos que el delito aparezca ejecutado en perjuicio del denunciante o de un pariente suyo de grado igual o mas proximo al que lo vincula con el denunciado. El denunciante no sera parte en el proceso ni tendra responsabilidad alguna, excepto por el delito que pudiere cometerse mediante la denuncia o en virtud comprendido entre estas generales de la Ley. DENUNCIA: Que el deponente resulta ser propietario de un vehiculo de marca Volkswagen, modelo Suran 1.6 Cross, de color roja, con dominio colocado PBF457, a√±o de fabricacion 2015, combustible NAFTA, motor numero CWS008181, chasis/cuadro numero 8AWPB45Z2GA500505, Posee equipo de GNC Regulador de Presion Marca TY11 numero de serie PBC1076256, Cilindro marca MQ12 numero de serie LZF2067. Posee seguro de la empresa Seguros Rivadavia. Que en el dia de la fecha siendo las 21:30hs horas aproximadamente, el dicente llega a su domicilio a bordo de su vehiculo, mismo lo estaciona en la trotadora marcha atras para ingresar el vehiculo en reversa, el dicente desciende y se dirige abrir el porton del garaje, al abrir el porton se acercan en contra mano dos sujetos masculinos a boro de una moto tipo enduro de color blanca con vivos color rojo, que el dicente escucha, ‚Äò‚ÄòEs el, es el, llevate este, es este auto (sic)‚Äô‚Äô, que el masculino que iba de acompa√±ante se baja de la moto y forcejea con el dicente, empujandolo hacia atras el se√±or Hernandez cae al piso, aprovechando la oportunidad este masculino y se  sube al vehiculo del dicente y se dan a la fuga por calle Maipu con direccion hacia Av. Juan H. Jara. Luego de lo sucedido el dicente pide ayuda y al ingresar a su casa llama al 911, haciendose presente un movil policial posteriormente. Consultado al dicente si estos masculinos exhibieron arma, refiere que NO. Consultado si resulto lesionado o con golpes por la caida, refiere que NO. Consultado sobre las caracteristicas de los masculinos, refiere que el masculino que esta de acompa√±ante es de contextura fisica delgado, de cutis moreno, de 23 a 25 a√±os de edad aproximadamente, de 1,70 de altura, viste campera de color negro con cuello, un jeans de color azul, en cuanto al masculino que estaba en la moto llevaba casco negro, no recuerda mas descripciones. Consultado si de volver a ver a los masculinos los reconocia, refiere que NO. Consultado al deponente si en el interior del rodado tenia algo, refiere que ‚Äò‚Äòtenia su billetera que en su interior tenia su Documento Nacional de Identidad, su Licencia de Conducir, cedula verde del auto, tarjeta de Credito Visa banco Santander Rio, tarjeta de debito del banco Santander, tarjeta del Gas, llaves de la casa de una amiga.‚Äô‚Äô Preguntado si recuerda cuanto combustible tenia, refiere que tenia medio tanque de combustible y de gas tenia un cuarto de tanque. Consultado por si el vehiculo posee alguna caracteristica particular refiere que tiene vidrios polarizados, luneta trasera tiene un stickers de Lubricentro F1 y la insignia de la Concesionaria Romera y en los laterales de las puertas tiene ploteo de Suran Cross en color negro. Consultado para que manifieste cuantos juegos de llaves posee y si puede exhibir, refiere que tiene dos juegos de llaves, una la sustraida y la otra la tiene en la casa, no la exhibe, en la llave sustraida tiene la llave del porton de su casa. Preguntado poseia algun desperfecto mecanico, refiere que NO. Consultado si recuerda kilometraje, refiere que tiene casi 220.000KM. Consultado si posee sistema de rastreo satelital, refiere que ‚ÄúNO‚Äù. Preguntado si en el ultimo tiempo lo llevo a algun taller mecanico, manifiesta que ‚Äúque en el dia de hoy le hizo cambiar el filtro de aceite por una perdida que tenia‚Äù. Preguntado si posee fotografias refiere que ‚Äò‚ÄòSI‚Äô‚Äô. Preguntado para que manifieste si sabe de la existencia de testigos refiere: ‚Äúque no habia nadie‚Äô‚Äô. Preguntado para que manifieste si en el lugar se emplazan camaras refiere que ‚Äò‚Äòque posee camaras en su domicilio y cuando logre descargar las imagenes las aportara‚Äô‚Äô. Consultado si sospecha de alguien, informa que ‚ÄúNO‚Äù. Preguntado para que manifieste si realizo cambios en la poliza de seguro refiere ‚Äò‚ÄòNO posee‚Äô‚Äô."                 </div>             </div>         </div>         </div>`)[0];

                var html_73fbfe3a5385f74bd39fd22cd11c9733 = $(`<div id="html_73fbfe3a5385f74bd39fd22cd11c9733" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-01-23 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>21:47:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>VERTIZ 7400</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO AGRAVADO POR EL USO DE ARMA DE FUERGO </td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "En la ciudad de Mar del Plata, partido de Gral. Pueyrredon, provincia de Buenos Aires, a los 23 dias del mes de enero del a√±o 2026, siendo las la suscripta Teniente Rampi, secundada en la oportunidad por el Sargento Acosta Victor, en circunstancias que se hallaban en prevencion de falta e ilicitos en general, mientras circulaban por calle Guanahani y Av. Polonia, un transeunte a bordo de un vehiculo los intercepta y les hace se√±as para que se detengan. Una vez entrevistado el masculino, el mismo refiere que le habian sustraido la moto en el barrio ‚ÄúLa Herradura‚Äù y que sabia que estaba en el pasillo por Pehuajo entre Vertiz y San Salvador, tratandose de una Gilera 110cc roja (ID 15754149). La Teniente Rampi realiza un recorrido por la zona, observando en el pasillo mencionado ut supra que se hallaban dos motovehiculos, uno de ellos de la misma caracteristica que el denunciado por el transeunte. Atento a ello, es que la Teniente Rampi solicita colaboracion en el lugar, arribando para ello el movil IO 29397, Sgto. Pe√±a, IO29601, Sgto. Rejas Braian y Oficial Mu√±oz Lucas, y movil RO 30174 a cargo de la Subteniente Jurado Magali y Oficial de Policia Veron Noelia, quienes realizan cerrojo por calle Vertiz y por calle San Salvador, mientras la Teniente Rampi junto al Sgto. Acosta ingresan por el pasillo donde se hallaban las motos y dos sujetos masculinos, quienes al percatarse de la presencia policial emprenden fugan ingresando a un domicilio del asentamiento ubicado en el lugar, en este lapso el sujeto individualizado por vestir camisa color verde y blanca, quien se descarta en la entrada del domicilio, un morral color azul. Se continua su persecucion hasta logra la aprehension de ambos sujetos masculinos. Que, al tratarse el lugar de un asentamiento donde los vecinos resultan ser reticentes con el personal policial, y de recibir agresiones a traves de que arrojaban piedrazos entre otros elementos, que entorpecian la labor policial, se procede a cargar los dos motovehiculos, el morral y a introducir a ambos sujetos en el interior del movil policial, trasladando todo ello a la dependencia policial que se encuentra emplazada a 400mts del lugar a fines resguardar la integridad de las personas demoradas y las del personal policial. Una vez en los asientos de Comisaria Decimosexta, se requiere de la presencia de un testigo de actuacion a quien impuesto por las penas con que la ley castiga el falso testimonio presta juramento de ley a producirse con veracidad en todos sus dichos y en todo lo que le fuere preguntado, recayendo tal responsabilidad sobre el ciudadano VILLALBA GUILLERMO HORACIO, argentino, de 45 a√±os de edad, soltero, de ocupacion cocinero, titular del DNI nro. 28.453.876, nacido el 05/11/1980, en Mar del Plata, domiciliado en calle Fitte nro. 2185, de este medio, abonado 223 5802067, delante de quien se procede a realizar un palpado sobre las prendas de ambos sujetos, no hallando elementos de interes, que pudieran atentar contra la integridad fisica propia y de terceros, arrojando resultado negativo, seguidamente se procede a dar lectura de derechos y garantias que por ley lo asisten manifestando ambos masculinos si, haberlos comprendido. Se continua con el secuestro del morral, del cual se  exhibe lo que hay en el interior, tratandose de (66) sesenta y seis envoltorios de nylon color blanco, que en su interior contiene una sustancia blanca, polvorienta, similar al clorhidrato de cocaina. Dinero en efectivo ciento cincuenta mil doscientos cincuenta pesos. Seguidamente, consultan ambos motovehiculos por sistema informatico, a traves del numero de motor 5DH1P50FMH2D5850928, el cual cursado por sistema informatico corresponde a una honda 110cc que posee ‚ÄúPedido de secuestro activo‚Äù con fecha 11/12/2025, de comisaria 13ra., como asi tambien el motovehiculo Gilera Smash color roja y negra con dominio colocado A277JHS, la cual arroja ‚ÄúAdelanto de secuestro activo‚Äù de fecha actual, todo lo mencionado resulta legalmente secuestrado bajo atenta mirada del testigo. Controlada la situacion se procede a identificar a los sujetos, manifestando el individualizado por descartarse el morral azul como: Difino Roman Agustin, argentino, instruido, de 18 a√±os de edad, soltero, desocupado, titular del DNI nro. 48.216.376, nacido el 10/01/2008, de este medio, domiciliado en calle (Vertiz y las vias, pasillo), hijo de Difino Eduardo Javier (v) y Corvalan Sandra Gisel (v), quien resulta ser de contextura fisica delgada, tez trigue√±a, de cabello casta√±o oscuro corto, de 1.80mts de altura, quien viste camiseta a rayas verde y blanco, pantalon negro y zapatillas negras. Mientras el segundo masculino, manifesto ser y llamarse: Bonaventura Luciano Iasaias, argentino, instruido, con fecha de nacimiento 05/10/2006, que no memorizaba su numero de documento de identidad. Seguidamente, en este acto se hace presente una ciudadana manifestando ser familiar del sujeto ‚Äúmenor‚Äù, quien se identifico como Alfonso Silvia Esperanza, aportando un Documento Nacional de Identidad, el cual poseia la foto de un menor de edad, no logrando distinguir con la fotografia si se trataba realmente del encausado que manifestaba ser menor de edad. Al indicarle al masculino que refiriera su fecha de nacimiento nuevamente para cotejar si el DNI se trataba del suyo, este responde como fecha de nacimiento 03/03/2009, dando cuenta que mentia los datos filiatorios. Siendo que a la femenina se le indica que se retire ya que se encontraba acompa√±ada de tres menores, de edades infantes. Al sentirse acorralado por la situacion, el mismo finalmente, refiere ser y llamarse: MONTALIVET LAUTARO EEQUIEL, argentino, instruido, de 17 a√±os de edad, soltero, desocupado, titular del DNI nro. 48.986.197, nacido el 21/10/2008, en Mar del Plata, domiciliado en calle Vertiz, nro. 7631, de este medio, hijo de Montalivet Cesar Ezequiel (V) y Bonaventura Nelida (V), quien resulta ser de contextura fisica delgada, de tez morena, de cabello oscuro corto, de 1.60 mts. de altura, quien viste remera roja, y short de futbol de boca color azul y amarillo, lleva puesto en los pies ojotas blancas. Tras ser consultado por sistema informatico posee CAPTURA ACTIVA, solicitada por el Juzgado del Joven n¬∞1, con fecha 05/09/2025, bajo IPP 020078/25-00. Una vez corroborado que el encausado resulta ser menor de edad, se lo notifica de la formacion de causa asistido por un adulto mayo, la ciudadana Palacios Evelyn Elizabeth, argentina, instruida, de 28 a√±os de edad, soltera, embasadora, titular del DNI nro. 45.131.277, nacida el 16/12/1997, en Mar del Plata, domiciliada en calle Camusso nro. 1699 de este medio, enterandoselo del contenido del ARTICULO 36 DE LA LEY 13.634 cuyo texto reza ‚ÄúEl ni√±o sujeto a proceso penal gozara de todos los derechos y garantias reconocidos a los mayores y en especial tendra derecho a: 1) Ser informado de los motivos de la investigacion y de la autoridad responsable de la misma, del derecho a no declarar contra si mismo y a solicitar la presencia inmediata de sus padres, tutores, responsables y su defensor: 2) No ser interrogado por autoridades policiales, militares, civiles o administrativas: 3) Recibir informacion clara y precisa de todas las autoridades intervinientes del fuero, sobre el significado de cada una de las actuaciones procesales que se desarrollan en su presencia, asi como del contenido y de las razones, incluso etico y sociales de las decisiones, de tal forma que el procedimiento cumpla su funcion educativa: 4) Que la privacion de la libertad sea solo una medida de ultimo recurso y que sea aplicada por el periodo mas breve posible, debiendo cumplirse en instituciones especificas para ni√±os, separadas de las de adulto, a cargo del personal especialmente capacitado, teniendo en cuenta las necesidades de su edad: 5) Comunicarse personalmente con la autoridad judicial, recibir visitas, e intercambiar correspondencia con su familia, al estudio y a la recreacion: 6) Que no se registren antecedentes policiales que perjudiquen su dignidad: 7) Que las decisiones sobre las medidas cautelares salidas alternativas al proceso, y requisitoria de elevacion a juicio, bajo pena de nulidad, se dicten en audiencia oral en su presencia, la de su defensor, acusador y demas intervinientes, conforme a los principios de continuidad, y mediacion, contradiccion y concentracion. Asimismo, se lo notifica del art. 12 de la Convencion del Ni√±o del derecho de ser escuchado. Seguidamente y conforme lo dispone el Art. 60 del CPPBA, se le hace saber que desde el primer momento del inicio de las actuaciones goza de las siguientes garantias minimas: 1) Ser informado sin demora en un idioma que comprenda y en forma detallada de la naturaleza y la causa de los cargos que se le imputan: 2) A comunicarse libremente con un letrado de su eleccion, y que le asiste el derecho de ser asistido y comunicado por el Defensor Oficial: 3) Que no esta obligado a declarar contra si mismo ni a confesarse culpable: 4) Los derechos que le asisten con relacion al responsable civil del hecho por el que se lo imputa si lo hubiere, y tambien respecto del asegurador, en caso de existir contrato, como asi mismo los derechos que lo asisten respecto de requerir al asegurador que asuma su defensa penal. Por ultimo se le notifica del articulo 1 de la LEY 22278, el cual reza: no es punible el menor que no haya cumplido dieciseis a√±os de edad. Tampoco lo es el que no haya cumplido dieciocho a√±os, respecto de delitos de accion privada o reprimidos con pena privativa de la libertad que no exceda de dos a√±os, con multa o con inhabilitacion. Si existiere imputacion contra alguno de ellos la autoridad judicial lo dispondra provisionalmente, procedera a la comprobacion del delito, tomara conocimiento directo del menor, de sus padres, tutor o guardador y ordenara los informes y peritaciones conducentes al estudio de su personalidad y de las condiciones familiares y ambientales en que se encuentre. En caso necesario pondra al menor en lugar adecuado para su mejor estudio durante el tiempo  indispensable. Si de los estudios realizados resultare que el menor se halla abandonado, falto de asistencia, en peligro material o moral, o presenta problemas de conducta, el juez dispondra definitivamente del mismo por auto fundado, previa audiencia de los padres, tutor o guardador. El movil 30504, a cargo de la Teniente Rampi, se dirige junto al testigo de actuacion a realizar a la sede de ‚Äúdrogas‚Äù el reactivo correspondiente a cargo de OSI Lescano Dario, corroborando que al tomar azarosamente el testigo una muestra del secuestro de la sustancia blanca, polvorienta, misma arroja resultado positivo para clorhidrato de cocaina. Al colocar en la balanza la totalidad de envoltorios, misma arroja un pesaje de 11.35gr. La Sargento Espinosa mantiene comunicacion con la Comisaria Duodecima, a fines consultar si habian recibido denuncia de un motovehiculo Gilera, 110cc, confirmando la existencia de la IPP 003635-26/00, efectuada por el ciudadano Montalivet Cesar Ezequiel, argentino, instruido, de 58 a√±os de edad, casado, empleado, titular del DNI nro. 18.674.850, nacido el 06/11/1967, domiciliado en calle Rivadavia nro. 12720, abonado 2236694848, quien manifiesta que se encontraba en su domicilio cuando advierte el ingreso al patio de su casa un motovehiculo 110cc con dos masculinos a bordo, mientras que en la vereda queda otro motovehiculo de 110cc abordado por dos masculinos mas, seguido observa ingresar a su nieto Montalivet Lautaro manipulando un arma de fuego, desconociendo tipo y calibre, con la cual apunta al interior de la vivienda donde se encontraba con su familia. Sustrayendole su motovehiculo marca Gilera modelo Smash 110, modelo 2025, motor nro. AD1P52FMHR0027535, NRO. CHASI 8CXSMASHSRNS70130, color rojo con detalles en negro. A esta altura, habiendo identificado correctamente a los causantes, y ante la intervencion de un menor de edad en el hecho, es que el jefe de turno, Comisario Ortiz Flavio, mantiene comunicacion con el FRPJ 3, a cargo del Sr. Agente Fiscal Dr. Walter Martinez Soto, quien interiorizado de los pormenores dispone se notifique de la formacion de causa por ROBO CALIFICADO POR EL USO DE ARMA DE FUEGO, se notifique a ambos causantes del articulo 60 CPP, se realicen diligencias de rigor, se traslade al menor al CEA, y al mayor a la unidad penal 44. Se remitan actuaciones escaneadas via email. Presentacion del menor a las 08:00hs en el FRPJ. Siendo las 02:00hs, la Sargento Espinosa Anahi, intenta mantener comunicacion con el abonado 2234225537, Juzgado de garantias del Joven 1, a cargo del Dr. Saumell, no logrando obtener respuesta. Siendo las 02:01hs se intenta entablar comunicacion con la Defensoria del Joven 4, De La Plaza, no logrando obtener respuesta. Siendo las 03:28hs, se logra mantener comunicacion con la Defensoria 4, Dr. De La Plaza, quien se interioriza de los pormenores en virtud al menor Montalivet. Cabe destacar que siendo las 02:20hs se traslada al menor Montalivet en el movil 30498 a cargo del Oficial Principal Silva, al CEA, por asi haberlo dispuesto el Sr. Agente Fiscal Dr. Martinez Soto, no siendo recibido por carecer de informe medico. Que, por la franja horaria, se carece de facultativo medico en sede de cuerpo medico de policia. Se traslada al menor al HIGA, informando que no habia medico hasta las 08:00hs. Se comienza a comunicar a los Centros de Primeros Auxilios, a fines corroborar si poseen guardia, encomendando un movil policial, quien entrevistado en el CAPS N¬∞ 2 de calle 12 de Octubre nro. 4445, quienes refieren que acerquemos al menor que realizarian una constancia medica de atencion. Misma es emitida por el Dr. Sandoval Jorgelina, 05:10hs. Se deja constancia que por la hora en la que se logra culminar la diligencia del examen medico legal, el menor Montalivet permanece en el movil RO 30498 a cargo del Oficial Principal Silva, para ser trasladado en breve a la fiscalia requerida. No siendo para mas el acto se da por finalizada la presente la cual es leida, ratificada, y firmada el pie por sus intervinientes para legal constancia. -"                 </div>             </div>         </div>         </div>`)[0];

 una moto tipo enduro de color blanca con vivos color rojo, que el dicente escucha, ‚Äò‚ÄòEs el, es el, llevate este, es este auto (sic)‚Äô‚Äô, que el masculino que iba de acompa√±ante se baja de la moto y forcejea con el dicente, empujandolo hacia atras el se√±or Hernandez cae al piso, aprovechando la oportunidad este masculino y se  sube al vehiculo del dicente y se dan a la fuga por calle Maipu con direccion hacia Av. Juan H. Jara. Luego de lo sucedido el dicente pide ayuda y al ingresar a su casa llama al 911, haciendose presente un movil policial posteriormente. Consultado al dicente si estos masculinos exhibieron arma, refiere que NO. Consultado si resulto lesionado o con golpes por la caida, refiere que NO. Consultado sobre las caracteristicas de los masculinos, refiere que el masculino que esta de acompa√±ante es de contextura fisica delgado, de cutis moreno, de 23 a 25 a√±os de edad aproximadamente, de 1,70 de altura, viste campera de color negro con cuello, un jeans de color azul, en cuanto al masculino que estaba en la moto llevaba casco negro, no recuerda mas descripciones. Consultado si de volver a ver a los masculinos los reconocia, refiere que NO. Consultado al deponente si en el interior del rodado tenia algo, refiere que ‚Äò‚Äòtenia su billetera que en su interior tenia su Documento Nacional de Identidad, su Licencia de Conducir, cedula verde del auto, tarjeta de Credito Visa banco Santander Rio, tarjeta de debito del banco Santander, tarjeta del Gas, llaves de la casa de una amiga.‚Äô‚Äô Preguntado si recuerda cuanto combustible tenia, refiere que tenia medio tanque de combustible y de gas tenia un cuarto de tanque. Consultado por si el vehiculo posee alguna caracteristica particular refiere que tiene vidrios polarizados, luneta trasera tiene un stickers de Lubricentro F1 y la insignia de la Concesionaria Romera y en los laterales de las puertas tiene ploteo de Suran Cross en color negro. Consultado para que manifieste cuantos juegos de llaves pose                 var html_954f74896d945f4a703d10e9fd9a5811 = $(`<div id="html_954f74896d945f4a703d10e9fd9a5811" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-01-23 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>21:47:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>VERTIZ 7400</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO AGRAVADO POR EL USO DE ARMA DE FUERGO </td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "En la ciudad de Mar del Plata, partido de Gral. Pueyrredon, provincia de Buenos Aires, a los 23 dias del mes de enero del a√±o 2026, siendo las la suscripta Teniente Rampi, secundada en la oportunidad por el Sargento Acosta Victor, en circunstancias que se hallaban en prevencion de falta e ilicitos en general, mientras circulaban por calle Guanahani y Av. Polonia, un transeunte a bordo de un vehiculo los intercepta y les hace se√±as para que se detengan. Una vez entrevistado el masculino, el mismo refiere que le habian sustraido la moto en el barrio ‚ÄúLa Herradura‚Äù y que sabia que estaba en el pasillo por Pehuajo entre Vertiz y San Salvador, tratandose de una Gilera 110cc roja (ID 15754149). La Teniente Rampi realiza un recorrido por la zona, observando en el pasillo mencionado ut supra que se hallaban dos motovehiculos, uno de ellos de la misma caracteristica que el denunciado por el transeunte. Atento a ello, es que la Teniente Rampi solicita colaboracion en el lugar, arribando para ello el movil IO 29397, Sgto. Pe√±a, IO29601, Sgto. Rejas Braian y Oficial Mu√±oz Lucas, y movil RO 30174 a cargo de la Subteniente Jurado Magali y Oficial de Policia Veron Noelia, quienes realizan cerrojo por calle Vertiz y por calle San Salvador, mientras la Teniente Rampi junto al Sgto. Acosta ingresan por el pasillo donde se hallaban las motos y dos sujetos masculinos, quienes al percatarse de la presencia policial emprenden fugan ingresando a un domicilio del asentamiento ubicado en el lugar, en este lapso el sujeto individualizado por vestir camisa color verde y blanca, quien se descarta en la entrada del domicilio, un morral color azul. Se continua su persecucion hasta logra la aprehension de ambos sujetos masculinos. Que, al tratarse el lugar de un asentamiento donde los vecinos resultan ser reticentes con el personal policial, y de recibir agresiones a traves de que arrojaban piedrazos entre otros elementos, que entorpecian la labor policial, se procede a cargar los dos motovehiculos, el morral y a introducir a ambos sujetos en el interior del movil policial, trasladando todo ello a la dependencia policial que se encuentra emplazada a 400mts del lugar a fines resguardar la integridad de las personas demoradas y las del personal policial. Una vez en los asientos de Comisaria Decimosexta, se requiere de la presencia de un testigo de actuacion a quien impuesto por las penas con que la ley castiga el falso testimonio presta juramento de ley a producirse con veracidad en todos sus dichos y en todo lo que le fuere preguntado, recayendo tal responsabilidad sobre el ciudadano VILLALBA GUILLERMO HORACIO, argentino, de 45 a√±os de edad, soltero, de ocupacion cocinero, titular del DNI nro. 28.453.876, nacido el 05/11/1980, en Mar del Plata, domiciliado en calle Fitte nro. 2185, de este medio, abonado 223 5802067, delante de quien se procede a realizar un palpado sobre las prendas de ambos sujetos, no hallando elementos de interes, que pudieran atentar contra la integridad fisica propia y de terceros, arrojando resultado negativo, seguidamente se procede a dar lectura de derechos y garantias que por ley lo asisten manifestando ambos masculinos si, haberlos comprendido. Se continua con el secuestro del morral, del cual se  exhibe lo que hay en el interior, tratandose de (66) sesenta y seis envoltorios de nylon color blanco, que en su interior contiene una sustancia blanca, polvorienta, similar al clorhidrato de cocaina. Dinero en efectivo ciento cincuenta mil doscientos cincuenta pesos. Seguidamente, consultan ambos motovehiculos por sistema informatico, a traves del numero de motor 5DH1P50FMH2D5850928, el cual cursado por sistema informatico corresponde a una honda 110cc que posee ‚ÄúPedido de secuestro activo‚Äù con fecha 11/12/2025, de comisaria 13ra., como asi tambien el motovehiculo Gilera Smash color roja y negra con dominio colocado A277JHS, la cual arroja ‚ÄúAdelanto de secuestro activo‚Äù de fecha actual, todo lo mencionado resulta legalmente secuestrado bajo atenta mirada del testigo. Controlada la situacion se procede a identificar a los sujetos, manifestando el individualizado por descartarse el morral azul como: Difino Roman Agustin, argentino, instruido, de 18 a√±os de edad, soltero, desocupado, titular del DNI nro. 48.216.376, nacido el 10/01/2008, de este medio, domiciliado en calle (Vertiz y las vias, pasillo), hijo de Difino Eduardo Javier (v) y Corvalan Sandra Gisel (v), quien resulta ser de contextura fisica delgada, tez trigue√±a, de cabello casta√±o oscuro corto, de 1.80mts de altura, quien viste camiseta a rayas verde y blanco, pantalon negro y zapatillas negras. Mientras el segundo masculino, manifesto ser y llamarse: Bonaventura Luciano Iasaias, argentino, instruido, con fecha de nacimiento 05/10/2006, que no memorizaba su numero de documento de identidad. Seguidamente, en este acto se hace presente una ciudadana manifestando ser familiar del sujeto ‚Äúmenor‚Äù, quien se identifico como Alfonso Silvia Esperanza, aportando un Documento Nacional de Identidad, el cual poseia la foto de un menor de edad, no logrando distinguir con la fotografia si se trataba realmente del encausado que manifestaba ser menor de edad. Al indicarle al masculino que refiriera su fecha de nacimiento nuevamente para cotejar si el DNI se trataba del suyo, este responde como fecha de nacimiento 03/03/2009, dando cuenta que mentia los datos filiatorios. Siendo que a la femenina se le indica que se retire ya que se encontraba acompa√±ada de tres menores, de edades infantes. Al sentirse acorralado por la situacion, el mismo finalmente, refiere ser y llamarse: MONTALIVET LAUTARO EEQUIEL, argentino, instruido, de 17 a√±os de edad, soltero, desocupado, titular del DNI nro. 48.986.197, nacido el 21/10/2008, en Mar del Plata, domiciliado en calle Vertiz, nro. 7631, de este medio, hijo de Montalivet Cesar Ezequiel (V) y Bonaventura Nelida (V), quien resulta ser de contextura fisica delgada, de tez morena, de cabello oscuro corto, de 1.60 mts. de altura, quien viste remera roja, y short de futbol de boca color azul y amarillo, lleva puesto en los pies ojotas blancas. Tras ser consultado por sistema informatico posee CAPTURA ACTIVA, solicitada por el Juzgado del Joven n¬∞1, con fecha 05/09/2025, bajo IPP 020078/25-00. Una vez corroborado que el encausado resulta ser menor de edad, se lo notifica de la formacion de causa asistido por un adulto mayo, la ciudadana Palacios Evelyn Elizabeth, argentina, instruida, de 28 a√±os de edad, soltera, embasadora, titular del DNI nro. 45.131.277, nacida el 16/12/1997, en Mar del Plata, domiciliada en calle Camusso nro. 1699 de este medio, enterandoselo del contenido del ARTICULO 36 DE LA LEY 13.634 cuyo texto reza ‚ÄúEl ni√±o sujeto a proceso penal gozara de todos los derechos y garantias reconocidos a los mayores y en especial tendra derecho a: 1) Ser informado de los motivos de la investigacion y de la autoridad responsable de la misma, del derecho a no declarar contra si mismo y a solicitar la presencia inmediata de sus padres, tutores, responsables y su defensor: 2) No ser interrogado por autoridades policiales, militares, civiles o administrativas: 3) Recibir informacion clara y precisa de todas las autoridades intervinientes del fuero, sobre el significado de cada una de las actuaciones procesales que se desarrollan en su presencia, asi como del contenido y de las razones, incluso etico y sociales de las decisiones, de tal forma que el procedimiento cumpla su funcion educativa: 4) Que la privacion de la libertad sea solo una medida de ultimo recurso y que sea aplicada por el periodo mas breve posible, debiendo cumplirse en instituciones especificas para ni√±os, separadas de las de adulto, a cargo del personal especialmente capacitado, teniendo en cuenta las necesidades de su edad: 5) Comunicarse personalmente con la autoridad judicial, recibir visitas, e intercambiar correspondencia con su familia, al estudio y a la recreacion: 6) Que no se registren antecedentes policiales que perjudiquen su dignidad: 7) Que las decisiones sobre las medidas cautelares salidas alternativas al proceso, y requisitoria de elevacion a juicio, bajo pena de nulidad, se dicten en audiencia oral en su presencia, la de su defensor, acusador y demas intervinientes, conforme a los principios de continuidad, y mediacion, contradiccion y concentracion. Asimismo, se lo notifica del art. 12 de la Convencion del Ni√±o del derecho de ser escuchado. Seguidamente y conforme lo dispone el Art. 60 del CPPBA, se le hace saber que desde el primer momento del inicio de las actuaciones goza de las siguientes garantias minimas: 1) Ser informado sin demora en un idioma que comprenda y en forma detallada de la naturaleza y la causa de los cargos que se le imputan: 2) A comunicarse libremente con un letrado de su eleccion, y que le asiste el derecho de ser asistido y comunicado por el Defensor Oficial: 3) Que no esta obligado a declarar contra si mismo ni a confesarse culpable: 4) Los derechos que le asisten con relacion al responsable civil del hecho por el que se lo imputa si lo hubiere, y tambien respecto del asegurador, en caso de existir contrato, como asi mismo los derechos que lo asisten respecto de requerir al asegurador que asuma su defensa penal. Por ultimo se le notifica del articulo 1 de la LEY 22278, el cual reza: no es punible el menor que no haya cumplido dieciseis a√±os de edad. Tampoco lo es el que no haya cumplido dieciocho a√±os, respecto de delitos de accion privada o reprimidos con pena privativa de la libertad que no exceda de dos a√±os, con multa o con inhabilitacion. Si existiere imputacion contra alguno de ellos la autoridad judicial lo dispondra provisionalmente, procedera a la comprobacion del delito, tomara conocimiento directo del menor, de sus padres, tutor o guardador y ordenara los informes y peritaciones conducentes al estudio de su personalidad y de las condiciones familiares y ambientales en que se encuentre. En caso necesario pondra al menor en lugar adecuado para su mejor estudio durante el tiempo  indispensable. Si de los estudios realizados resultare que el menor se halla abandonado, falto de asistencia, en peligro material o moral, o presenta problemas de conducta, el juez dispondra definitivamente del mismo por auto fundado, previa audiencia de los padres, tutor o guardador. El movil 30504, a cargo de la Teniente Rampi, se dirige junto al testigo de actuacion a realizar a la sede de ‚Äúdrogas‚Äù el reactivo correspondiente a cargo de OSI Lescano Dario, corroborando que al tomar azarosamente el testigo una muestra del secuestro de la sustancia blanca, polvorienta, misma arroja resultado positivo para clorhidrato de cocaina. Al colocar en la balanza la totalidad de envoltorios, misma arroja un pesaje de 11.35gr. La Sargento Espinosa mantiene comunicacion con la Comisaria Duodecima, a fines consultar si habian recibido denuncia de un motovehiculo Gilera, 110cc, confirmando la existencia de la IPP 003635-26/00, efectuada por el ciudadano Montalivet Cesar Ezequiel, argentino, instruido, de 58 a√±os de edad, casado, empleado, titular del DNI nro. 18.674.850, nacido el 06/11/1967, domiciliado en calle Rivadavia nro. 12720, abonado 2236694848, quien manifiesta que se encontraba en su domicilio cuando advierte el ingreso al patio de su casa un motovehiculo 110cc con dos masculinos a bordo, mientras que en la vereda queda otro motovehiculo de 110cc abordado por dos masculinos mas, seguido observa ingresar a su nieto Montalivet Lautaro manipulando un arma de fuego, desconociendo tipo y calibre, con la cual apunta al interior de la vivienda donde se encontraba con su familia. Sustrayendole su motovehiculo marca Gilera modelo Smash 110, modelo 2025, motor nro. AD1P52FMHR0027535, NRO. CHASI 8CXSMASHSRNS70130, color rojo con detalles en negro. A esta altura, habiendo identificado correctamente a los causantes, y ante la intervencion de un menor de edad en el hecho, es que el jefe de turno, Comisario Ortiz Flavio, mantiene comunicacion con el FRPJ 3, a cargo del Sr. Agente Fiscal Dr. Walter Martinez Soto, quien interiorizado de los pormenores dispone se notifique de la formacion de causa por ROBO CALIFICADO POR EL USO DE ARMA DE FUEGO, se notifique a ambos causantes del articulo 60 CPP, se realicen diligencias de rigor, se traslade al menor al CEA, y al mayor a la unidad penal 44. Se remitan actuaciones escaneadas via email. Presentacion del menor a las 08:00hs en el FRPJ. Siendo las 02:00hs, la Sargento Espinosa Anahi, intenta mantener comunicacion con el abonado 2234225537, Juzgado de garantias del Joven 1, a cargo del Dr. Saumell, no logrando obtener respuesta. Siendo las 02:01hs se intenta entablar comunicacion con la Defensoria del Joven 4, De La Plaza, no logrando obtener respuesta. Siendo las 03:28hs, se logra mantener comunicacion con la Defensoria 4, Dr. De La Plaza, quien se interioriza de los pormenores en virtud al menor Montalivet. Cabe destacar que siendo las 02:20hs se traslada al menor Montalivet en el movil 30498 a cargo del Oficial Principal Silva, al CEA, por asi haberlo dispuesto el Sr. Agente Fiscal Dr. Martinez Soto, no siendo recibido por carecer de informe medico. Que, por la franja horaria, se carece de facultativo medico en sede de cuerpo medico de policia. Se traslada al menor al HIGA, informando que no habia medico hasta las 08:00hs. Se comienza a comunicar a los Centros de Primeros Auxilios, a fines corroborar si poseen guardia, encomendando un movil policial, quien entrevistado en el CAPS N¬∞ 2 de calle 12 de Octubre nro. 4445, quienes refieren que acerquemos al menor que realizarian una constancia medica de atencion. Misma es emitida por el Dr. Sandoval Jorgelina, 05:10hs. Se deja constancia que por la hora en la que se logra culminar la diligencia del examen medico legal, el menor Montalivet permanece en el movil RO 30498 a cargo del Oficial Principal Silva, para ser trasladado en breve a la fiscalia requerida. No siendo para mas el acto se da por finalizada la presente la cual es leida, ratificada, y firmada el pie por sus intervinientes para legal constancia. -"                 </div>             </div>         </div>         </div>`)[0];

M, MODELO: ADVENTURE 390, DOMINIO: A248UKQ, CUADRO N¬∞8EZJGJ40ASA200269, MOTOR N¬∞ P-938*29731*, A√ëO DE FABRICACION 2025, COLOR AZUL YNARANJA. Seguidamente dichos sujetos se retiran por calle Padre Cardiel en direccion a Ruta N¬∞2, conambos rodados. Preguntado sobre alguna caracteristica fisica de los autores del hecho refiere que elacompa√±ante tenia buzo y pantalon color claro y tenia la cara cubierta encapuchado y que no puede aportarmas descripciones de los mismos. Que dentro de la, motocicleta habia una mochila color azul sin marca, lacual contenia: un estuche color negro, con herramientas varias marcas Montaig, un cuaderno anillado, y lasuma de $ de 200.000 mil pesos argentinos. Consultado si le sustrajeron algun dispositivo que tuvierageolocalizacion o rastreo satelital refiere que no, o si el vehiculo lo tenia refiere que no tenia. Consultado porel kilometraje del rodado refiere que 3000 kilometros aproximadamente. Consultado sobre la cantidad decombustible y tipo, refiere que tanque lleno, de nafta. Indagado sobre seguro dice que de la empresaMAPFRE POLIZA N¬∞ 108-00247929-01, tipo de cobertura MOTO BASICA MAS. Preguntado si poseealguna caracteristica particular refiere que le coloco un parabrisas marca PFERD y una baulera marca GIVI,color negro. Que despues se encontraba original de fabrica. Que poseia el dominio colocado. Consultadosobre si reconoceria a estos sujetos refiere que no. Indagado sobre si cambio de seguro recientemente refiereque no. Preguntado si poseia alguna falla mecanica refiere que ninguna. Consultado si poseia VTV, refiereque es nueva. Consultado si llamo al 911 refiere que si. Indagado sobre testigos del hecho en el lugar diceque habia unos vecinos pero que salieron cuando estos sujetos ya habian retirado. Preguntado sobre camarasen el lugar refiere que desconoce. Preguntado si posee llaves de ignicion, dice que una se la llevaron con la moto y tiene un duplicado en su domicilio, el que no exhibe en este acto, que despues aportara. Que es todocuanto dese denunciar"                 </div>             </div>         </div>         </div>`)[0];

r del hecho, refiere no habia nadie en la calle. Interrogado si su motovehiculo poseia alguna falla mecanica, responde que funcionaba correctamente. Preguntado si el motovehiculo posee alguna particularidad como calcomanias y/o da√±o sobre la chapa, responde original de fabrica, ‚Äútiene un monton de rayones, el espejo retrovisor izquierdo esta roto y tiene una cinta, las barras de defensa se las cambie, el chapon del carter lo pinte de negro.‚Äù Una vez realizada una amplia lectura de su denuncia confeccionada se le consulta si desea agregar algo al plexo de su declaracion, responde que No. Que es todo cuanto desea denunciar."                 </div>             </div>         </div>         </div>`)[0];

                var html_4173ddb81164357997b1ef046b4d4a47 = $(`<div id="html_4173ddb81164357997b1ef046b4d4a47" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-01-28 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>20:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>RUTA 11 0</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO AGRAVADO  (uso de armas de fuego) - Art.166 Inc.2¬∫ p√°rr. 2do</td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "Que soy propietario de un Motovehiculo marca Benelli, modelo TNT 600,m color blanca con detalles negros, con ambos espejos retrovisores colocados, a√±o de fabricacion 2025, de 600 Cilindradas, dominio colocado A 217IAD, motor N¬∞ BJ465MS-A*13805745*, cuadro N¬∞ 8ELB04APAPB037124, cachas delanteras ploteadas de color negro carbono y maletas regulables color bandera de Italia. A consultas por la instruccion digo que en la fecha, alrededor de las 18.00 horas, Sali a bordo de mi moto de la casa de mi novia, sito en calle Caseros y la Costa, por lo que tome por la Costa en sentido a Miramar, hasta el barrio Chapadmalal: ya que es habitue en mi salir a andar con mi moto por la costa. Que, al llegar, haciendo mencion que voy despacio no mas de 50 a 60 km por hora: por lo que tardo en realizar el recorrido: retomo mis pasos por Ruta 11 en sentido a Mar del Plata, es que, al llegar aproximadamente a la altura de la Estancia la Moringa, yo estaba circulando por el medio de la calle, ya que no habia transito, es que por la derecha me alcanza una moto del tipo honda tornado, color roja, sin varias de sus cachas, con dos masculinos a bordo. Que el conductor de dicha moto, se me pone a la par, observando que el acompa√±ante, quien ya con una de sus manos, no pudiendo especificar derecha o izquierda, me apunta con un arma de fuego del tipo revolver, color plateado: manifestando textual ‚ÄúPARA, PARA, LA CONCHA DE TU MADRE‚Äù sic, automaticamente detengo mi marcha, tiro la moto en la ruta, y salgo corriendo hacia el lado de los Acantilados,  escondiendome entremedio de los arboles. Que pasado unos 5 minutos, no pudiendo especificar, por los nervios, es que salgo nuevamente a la Ruta y observo que estos sujetos ya no estaban como asi mi moto, por lo que llamo al 911, dando cuenta de lo que me habia ocurrido. A consultas por la instruccion digo que en cuanto a la moto en que se movilizaban los sujetos no vie otra caracteristica de la misma, como si tiene patente, misma ruidosa propia de la moto. En cuanto a los sujetos, recuerdo que su conductor, de apariencia joven, delgado, estatura media, mismo con casco negro liso, vestia una campera rompe viento color negra, mientras que el acompa√±ante recuerdo que tambien parecia joven, delgado, de aprox 1.701 metros de altura, misma tenia un casco colocado color negro con su visor a medio bajar, por lo que solo vi que era morocho, sin ninguna caracteristica especifica que llame mi atencion. Dicho masculino vestia una campera color negra del tipo de abrigo, con cuello alto, no recordando demas datos del mismo. Preguntado para que diga si puede recordar el tono de voz del sujeto que le hablo, digo que era normal, del tipo de ‚Äúlos pibes guachiturros‚Äù, en relacion al conductor en ningun momento hablo. Preguntado para que diga si recuerda si el sujeto armado, llamo por nombre y/o apodo al otro masculino digo que no le escuche, si es que le hablo. Consultado para que mencione si pudo ver para donde se dieron a la fuga los sujetos, digo que no lo vi, dado que Sali al trote al instante, dandole la espalda en todo momento. Consultado para que diga si en cuanto al arma pudo ver alguna otra caracteristica de la misma, digo que para mi entender era un revolver calibre 22 largo. A esta altura se le consulta si recuerda si al momento del hecho habia persona o vehiculo que pudiera presenciar el mismo, digo que desconozco, ya que todo fue muy rapido. Consultado para que mencione si recuerda cuantos kilometros tenia su moto, digo 15.000 km, la cual estaba en perfecto estado de uso y mantenimiento, ya que la compre de 0 km y es de uso particular, no debiendo ser llevaba a ningun taller, salvo el servis los cuales los primeros dos fue en donde la compre Arrate, sito en calle Juan B Justo 6400, mientras que el ultimo servis lo hice yo, hara menos de un mes. Preguntado para que mencione si recuerda cuanto combustible tenia la moto digo que alrededor de medio tanque, con una autonomia de aprox. 80 km dependen el uso, siendo la ultima vez que cargue, en la fecha, en la estacion de servicio Shell de Constitucion y La Costa, y solo le puse 5.000 pesos de nafta, ya que tenia. Preguntado para que diga si tiene rastreo satelital, digo que no. Preguntado para que diga si esta en condiciones de reconocer a los autores del presente hecho, digo que no, ya que fue rapido y los rostros cubiertos. Preguntado para que mencione si vio camaras municipales en la zona del hecho, digo que no vi, ya que es una zona despoblada. Que tengo seguro en la compa√±ia Allianz, poliza 250290380084, cobertura robo e incendio: pero al momento no le informe de la sustraccion del bien. Por ultimo menciono que en la moto no tenia pertenencia alguna con geolocalizacion. Que en cuanto VTV, misma es nueva y todavia no debia hacerla. Llame al 911.No sufro lesiones. En cuanto a las llaves de arranque, originales, tenia colocadas y se las llevaron junto a la moto, en cuanto copia tengo en mi  domicilio, comprometiendome a aportar las mismas. Que es todo cuanto denuncia, no siendo para mas el acto, lee y firma al pie para legal constancia junto a los actuantes que de ello certifican."                 </div>             </div>         </div>         </div>`)[0];

da por dos masculinos que circulaban en una moto tipo 110 cc, color negra con algunos detalles en blanco. Uno de ellos , mas precisamente el acompa√±ate y agresor, de cabello corto, de aproximadamente 1.70 m de altura, contextura delgada , vestia una remera de color oscura y un pantalon de jean claro, desciende del rodado e inmediatamente comienza a golpearle la ventana del conductor de su vehiculo, en ese preciso momento el agresor es que saca de entre sus prendas una navaja increpandola, insultandola y gritandole que se baje del vehiculo y que le entregue las llaves, a lo que la denunciante desciende de su rodado y es empujada contra un poste de luz que se encuentra sobre la vereda de su domicilio, haciendo que se golpee la cabeza contra el poste y caiga al piso. Posteriormente a esto la denunciante entra corriendo a su domicilio, y alcanza a divisar que tanto el motovehiculo como la camioneta se retiran del lugar doblando en la calle Alejandro Korn, sentido a calle 12 de Octubre. Preguntado para que manifieste si de volver a verlo/s se encuentra en condiciones de reconocer/los refiere que al agresor si. Preguntado para que manifieste si puede describir el arma utilizada refiere que solo pudo divisar una navaja de pocos centimetros de largo. Preguntado si producto del hecho sufrio lesiones refiere que solo el golpe en la cabeza y en la rodilla producto del golpe. Lugar de asistencia, centro de salud/nosocomio, constancia de atencion y agregar nota para el medico de policia. Se le entera que el dominio se procede a la carga en el sistema LPR (LECTOR DE PATENTE MUNICIAL) a traves del COM. Que es cuanto tiene que denunciar al respecto , seguidamente se le entera y notifica del contenido de los articulos 83 al 88 del CPP. Que dan cuenta del denunciante."                 </div>             </div>         </div>         </div>`)[0];

. Que, al llegar, haciendo mencion que voy despacio no mas de 50 a 60 km por hora: por lo que tardo en realizar el recorrido: retomo mis pasos por Ruta 11 en sentido a Mar del Plata, es que, al llegar aproximadamente a la altura de la Estancia la Moringa, yo estaba circulando por el medio de la calle, ya que no habia transito, es que por la derecha me alcanza una moto del tipo honda tornado, color roja, sin varias de sus cachas, con dos masculinos a bordo. Que el conductor de dicha moto, se me pone a la par, observando que el acompa√±ante, quien ya con una de sus manos, no pudiendo especificar derecha o izquierda, me apunta con un arma de fuego del tipo revolver, color plateado: manifestando textual ‚ÄúPARA, PARA, LA CONCHA DE TU MADRE‚Äù sic, automaticamente detengo mi marcha, tiro la moto en la ruta, y salgo corriendo hacia el lado de los Acantilados,  escondiendome entremedio de los arboles. Que pasado unos 5 minutos, no pudiendo especificar, por los nervios, es que salgo nuevamente a la Ruta y observo que estos sujetos ya no estaban como asi mi moto, por lo que llamo al 911, dando cuenta de lo que me habia ocurrido. A consultas por la instruccion digo que en cuanto a la moto en que se movilizaban los sujetos no vie otra caracteristica de la misma, como si tiene patente, misma ruidosa propia de la moto. En cuanto a los sujetos, recuerdo que su conductor, de apariencia joven, delgado, estatura media, mismo con casco negro liso, vestia una campera rompe viento color negra, mientras que el acompa√±ante recuerdo que tambien parecia joven, delgado, de aprox 1.701 metros de altura, misma tenia un casco colocado color negro con su visor a medio bajar, por lo que solo vi que era morocho, sin ninguna caracteristica especifica que llame mi atencion. Dicho masculino vestia una campera color negra del tipo de abrigo, con cuello alto, no recordando demas datos del mismo. Preguntado para que diga si puede recordar el tono de voz del sujeto que le hablo, digo que era normal, del tipo de ‚Äúlos pibes guachiturros‚Äù, en relacion al conductor en ningun momento hablo. Preguntado para que diga si recuerda si el sujeto armado, llamo por nombre y/o apodo al otro masculino digo que no le escuche, si es que le hablo. Consultado para que mencione si pudo ver para donde se dieron a la fuga los sujetos, digo que no lo vi, dado que Sali al trote al instante, dandole la espalda en todo momento. Consultado para que diga si en cuanto al arma pudo ver alguna otra caracteristica de la misma, digo que para mi entender era un revolver calibre 22 largo. A esta altura se le consulta si recuerda si al momento del hecho habia persona o vehiculo que pudiera presenciar el mismo, digo que desconozco, ya que todo fue muy rapido. Consultado para que mencione si recuerda cuantos kilometros tenia su moto, digo 15.000 km, la cual estaba en perfecto estado de uso y mantenimiento, ya que la compre de 0 km y es de uso particular, no debiendo ser llevaba a ningun taller, salvo el servis los cuales los primeros dos fue en donde la compre Arrate, sito en calle Juan B Justo 6400, mientras que el ultimo servis lo hice yo, hara menos de un mes. Preguntado para que mencione si recuerda cuanto combustible tenia la moto digo que alrededor de medio tanque, con una autonomia de aprox. 80 km dependen el uso, siendo la ultima vez que cargue, en la fecha, en la estacion de servicio Shell de Constitucion y La Costa, y solo le puse 5.000 pesos de nafta, ya que tenia. Preguntado para que diga si tiene rastreo satelital, digo que no. Preguntado para que diga si esta en condiciones de reconocer a los autores del presente hecho, digo que no, ya que fue rapido y los rostros cubiertos. Preguntado para que mencione si vio camaras municipales en la zona del hecho, digo que no vi, ya que es una zona despoblada. Que tengo seguro en la compa√±ia Allianz, poliza 250290380084, cobertura robo e incendio: pero al momento no le informe de la sustraccion del bien. Por ultimo menciono que en la moto no tenia pertenencia alguna con geolocalizacion. Que en cuanto VTV, misma es nueva y todavia no debia hacerla. Llame al 911.No sufro lesiones. En cuanto a las llaves de arranque, originales, tenia colocadas y se las llevaron junto a la moto, en cuanto copia tengo en mi  domicilio, comprometiendome a aportar las mismas. Que es todo cuanto denuncia, no siendo para mas el acto, lee y firma al pie para legal constancia junto a los actuantes que de ello certifican."                 </div>             </div>         </div>         </div>`)[0];

omienza a gritarle exigiendo que se baje del vehiculo, para subir al mismo y fugar por Pedraza hacia Camet a bordo de su vehiculo, mientras que el otro continua a bordo de la motocicleta hacia Pedraza hacia camet Preguntado si recuerda alguna caracteristica en particular del vehiculo, refiere: No, solo lo ya descrito, sin poder precisar otras circunstancias. Interrogado respecto de las caracteristicas fisonomicas y vestimenta de los autores del hecho, refiere: que no. Examinado para que diga si se encuentra en condiciones de reconocer a los autores del hecho, relata: NO, que no pudo ver sus rostros ya que ambos tenian cascos colocados. Consultado para refiera si escucho algun tipo de tonada distinta en el habla de los sujetos, cuenta: No, el que lo apunto con el arma parecia ser joven, el otro no le hablo. Preguntado si escucho algun tipo de apodo o forma en la que los autores se llamaran entre si, manifiesta: No, que ellos no hablaron entre si. Interrogado si tiene el conocimiento de la existencia de camaras de seguridad en el lugar del hecho, responde: que no. Indagado respecto de la cantidad de juegos de llaves que posee del vehiculo para exhibir, dice que posee otro ejemplar Examinado en relacion a la cantidad de kilometros que posee su vehiculo, manifiesta: que 265.000 Km aproximadamente. Preguntado cuanto poseia de combustible en su tanque, dice que ¬º tanque aproximado de combustible Diesel. Indagado si el rodado posee equipo de GNC, relata: No Consultado si posee algun sistema de rastreo por geolocalizacion de su vehiculo, expresa que no posee ningun contrato de rastreador. Examinado si posee seguro y que tipo de cobertura posee, responde que tiene su vehiculo asegurado por ACA SEGUROS, poliza N¬∞ 8049-3007571, contra terceros. Preguntado si en el ultimo tiempo realizo cambio de compa√±ia de seguro, responde que siempre tuvo el mismo. Consultado si conoce de la existencia de testigos presenciales en el lugar del hecho, responde que desconoce hasta el momento. Interrogado si su vehiculo poseia alguna falla mecanica, responde que funcionaba correctamente teniendo la VTV al dia. Indagado si posee taller mecanico que lleve su vehiculo a realizar reparaciones o servis rutinarios, responde que siempre lo lleva al mismo que queda en lomas del mirador en buenos aires. Examinado si poseia elementos en el interior de su vehiculo que desea aclarar, responde que los elementos que poseia eran todas las tarjetas bancarizadas, DNI, tarjeta verde y restos de papeles, tarjeta sube, la documentacion del automovil club, sin mas elementos. Preguntado si realizo al momento de constatar el faltante llamado al 911, responde que no, llama cuando llega a su domicilio.  Preguntado si el vehiculo posee alguna particularidad como calcomanias, polarizado y/o da√±o sobre la chapa, responde que posei la etiqueta de tele pase. Una vez realizada una amplia lectura de su denuncia, se le consulta si desea agregar algo al plexo de su declaracion, responde que No."                 </div>             </div>         </div>         </div>`)[0];

                var html_1e5b5096918f4f6aa98571e7aab30033 = $(`<div id="html_1e5b5096918f4f6aa98571e7aab30033" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-01-30 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>22:30:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>L. BAUTISTA 3164</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO AGRAVADO  (uso de armas de fuego) - Art.166 Inc.2¬∫ p√°rr. 2do</td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "Refiere que, en el dia de la fecha, siendo aproximadamente las 23:00 horas, se hace presente en esta seccional el Sr. Mansilla Marcelo Javier.Que su hijo resulta ser propietario de un vehiculo marca Mercadez Benz modelo C200 EDITION C tipo sedan 4 puertas color gris metalizado, dominios colocados OIF803, a√±o de fabricacion 2014 combustible a nafta, motor numero 27186030719108 y numero de chasis WDDGF4JB7EG233429, desde el a√±o 2014 . Refiere que el dia 30 de enero de 2026, siendo aproximadamente las 22:30 horas, se encontraba en el domicilio de su amigo Brian Caramelo, sito en calle Bautista N.¬∫ 3464, donde se hallaba compartiendo un asado junto  a integrantes del club. Que, en un momento dado, al comenzar a comer, se percata de que habia olvidado descender de su vehiculo el pan que habia comprado, motivo por el cual sale por la puerta principal del domicilio y se dirige hacia su automovil. Al abrir la puerta del lado del acompa√±ante e inclinarse para tomar el mencionado elemento, siente la presencia de una persona a su espalda, quien le habla y le pregunta si su auto era un Mercedes. Que, al darse vuelta, creyendo que se trataba de uno de los presentes, observa que no era asi, visualizando en ese momento a dos masculinos, uno de los cuales se encontraba armado con un arma de fuego tipo revolver. Los mismos se movilizaban en una motocicleta tipo enduro, la cual poseia el tanque de color blanco, encontrandose uno de los sujetos a bordo del rodado y el otro de pie, quien lo apuraba exigiendole que entregue sus pertenencias. Describe que uno de los masculinos vestia campera de equipo de futbol, mientras que el restante llevaba campera gris, sin casco, con visera blanca y capucha negra. Que acto seguido, el masculino armado le arranca una cadena de oro que llevaba puesta y, a viva voz, le ordena que se baje del vehiculo. Que, al sujetarse del auto, el agresor advierte que tambien llevaba colocado un anillo de oro, el cual le exige de manera exaltada, solicitandole ademas la billetera, manifestandole el denunciante que no la tenia en su poder. Finalmente, ante la situacion de intimidacion, procede a entregar las llaves de su automovil, retirandose luego los masculinos del lugar. Por lo cual yo procedo a advertirles a mis amigos de lo ocurrido,momentos posteriores los mismos me acompa√±an a la comisaria jurisdiccional a realizar la correspondiente denuncia. - Consultado para que manifieste si posee la documentacion del rodado, exhibe: Registro de conducir, cedula verde a nombre del hijo el se√±or De Olivera Javier Antonio, y tarjeta de seguro del rodado de compa√±ia La caja. Preguntado si el vehiculo posee sistema de alarma y/o cierre centralizado, trabas volantes, corta corriente refiere que si,. Consultado si habitualmente deja el rodado estacionado en ese lugar, refiere que es la primera vez. Preguntado si recuerda cuanto combustible tenia manifiesta que medio tanque. Consultado por si el vehiculo posee alguna caracteristica particular, refiere que tiene una calcomania del club Juventus en el baul y la de Jiujitsu Solum. Consultado para que manifieste cuantas llaves posee y si puede exhibir la/s misma/s refiere que posee tres en total, una la que se llevaron y dos copias mas en la casa.-Preguntado si poseia algun desperfecto mecanico, refiere que no. Consultado si recuerda kilometraje refiere 220.000 km aproximadamente. Consultado si en el interior del rodado poseia algun elemento de valor/personal, refiere: lentes de ver de cerca con marco color negro, un celular Xiaomi Note 11 color dorado con funda trasparente sin chip el cual conectaba con las camaras del vehiculo. Preguntado si habia algun elemento electronico, ya sea rastreable o no, refiere que no. Consultado si posee sistema de rastreo satelital, refiere que no . Preguntado si en el ultimo tiempo lo llevo a algun taller mecanico, manifiesta que no. Preguntado si posee fotografias refiere si y las aporta en este acto. Preguntado para que manifieste si luego del hecho llamo al 911 refiere que no, que vino a la comisaria. Preguntado para que manifieste si sabe de la existencia de testigos refiere que no recuerda. Preguntado para que manifieste si en el lugar se emplazan camaras refiere que no. - Preguntado para que manifieste si el rodado posee equipo de GNC refiere que no. Consultado si sospecha de alguien, informa que no. Preguntado el recorrido que realizo hasta llegar al lugar de la sustraccion refiere que se encontraba en su domicilio sita en calle Bahia Blanca altura catastral 2600, que sale por calle Bahia Blanca hasta Alberti, Alberti dobla hacia la izquierda hasta la rotonda de Champagnat, Champagnat hasta Carballo y Carballo hasta el domicilio donde sucedio el hecho. Preguntado si el rodado posee Vtv y fecha de la ultima vez que realizo refiere: que si y que la realizo en marzo del a√±o 2025. Preguntado ultima vez que realiza service al rodado refiere: que no recuerda - Preguntado para que manifieste si puede aportar descripciones del/los autor/es, manifiesta que solo recuerda  lo antes mencionado. Preguntado para que manifieste si de volver a verlo/s se encuentra en condiciones de reconocerlo/s refiere: que a uno si Preguntado para que manifieste si puede describir el arma utilizada refiere que era un arma de fuego tipo revolver color negro. - Preguntado si producto del hecho sufrio lesiones refiere que no y que tampoco requiere asistencia medica . Seguidamente se le entera y notifica del contenido de los articulos 83 al 88 del CPP. Que dan cuenta de los derechos del denunciante. Sin mas , se da por finalizada la correspondiente denuncia "                 </div>             </div>         </div>         </div>`)[0];

e centralizado, trabas volantes, corta corriente refiere que si,. Consultado si habitualmente deja el rodado estacionado en ese lugar, refiere que es la primera vez. Preguntado si recuerda cuanto combustible tenia manifiesta que medio tanque. Consultado por si el vehiculo posee alguna caracteristica particular, refiere que tiene una calcomania del club Juventus en el baul y la de Jiujitsu Solum. Consultado para que manifieste cuantas llaves posee y si puede exhibir la/s misma/s refiere que posee tres en total, una la que se llevaron y dos copias mas en la casa.-Preguntado si poseia algun desperfecto mecanico, refiere que no. Consultado si recuerda kilometraje refiere 220.000 km aproximadamente. Consultado si en el interior del rodado poseia algun elemento de valor/personal, refiere: lentes de ver de cerca con marco color negro, un celular Xiaomi Note 11 color dorado con funda trasparente sin chip el cual conectaba con las camaras del vehiculo. Preguntado si habia algun elemento electronico, ya sea rastreable o no, refiere que no. Consultado si posee sistema de rastreo satelital, refiere que no . Preguntado si en el ultimo tiempo lo llevo a algun taller mecanico, manifiesta que no. Preguntado si posee fotografias refiere si y las aporta en este acto. Preguntado para que manifieste si luego del hecho llamo al 911 refiere que no, que vino a la comisaria. Preguntado para que manifieste si sabe de la existencia de testigos refiere que no recuerda. Preguntado para que manifieste si en el lugar se emplazan camaras refiere que no. - Preguntado para que manifieste si el rodado posee equipo de GNC refiere que no. Consultado si sospecha de alguien, informa que no. Preguntado el recorrido que realizo hasta llegar al lugar de la sustraccion refiere que se encontraba en su domicilio sita en calle Bahia Blanca altura catastral 2600, que sale por calle Bahia Blanca hasta Alberti, Alberti dobla hacia la izquierda hasta la rotonda de Champagnat, Champagnat hasta Carballo y Carballo hasta el domicilio donde sucedio el hecho. Preguntado si el rodado posee Vtv y fecha de la ultima vez que realizo refiere: que si y que la realizo en marzo del a√±o 2025. Preguntado ultima vez que realiza service al rodado refiere: que no recuerda - Preguntado para que manifieste si puede aportar descripciones del/los autor/es, manifiesta que solo recuerda  lo antes mencionado. Preguntado para que manifieste si de volver a verlo/s se encuentra en condiciones de reconocerlo/s refiere: que a uno si Preguntado para que manifieste si puede describir el arma utilizada refiere que era un arma de fuego tipo revolver color negro. - Preguntado si producto del hecho sufrio lesiones refiere que no y que tampoco requiere asistencia medica . Seguidamente se le entera y notifica del contenido de los articulos 83 al 88 del CPP. Que dan cuenta de los derechos del denunciante. Sin mas , se da por finalizada la correspondiente denuncia "                 </div>             </div>         </div>         </div>`)[0];

smo llevaba colocado un casco de color negro, detras de su auto en la calle se encontraba otro sujeto a bordo de una moto de gran cilindrada de color negra, que este masculino tambien tenia casco colocado y vestia prendas de color negro, el dicente intento acercarse hacia su auto y el sujeto que estaba en la moto le ordeno que se quede quieto, el dicente permanece quieto y estos sujetos se dan a la fuga por calle Francia con direccion hacia Av. Constitucion. Luego de lo sucedido el dicente llama al 911, haciendose presente posteriormente un movil policial. Consultado al dicente sobre las caracteristicas de los masculinos, refiere que eran dos sujetos masculinos de aproximadamente 1,75 de altura, de contextura fisica delgados, prendas de vestir de color negro, de aproximadamente 30 a 40 a√±os de edad. Consultado si de volver a ver a los masculinos lo reconoceria, refiere que NO. Consultado al dicente si resulto lesionado o golpeado, refiere que NO. Consultado al dicente si exhibieron algun tipo de arma, refiere que no observa. Consultado al deponente si en el interior del rodado tenia algo, refiere que ‚Äò‚Äòtenia su celular de marca Motorola, modelo Edge 50 Pro, de color negro, con numero de abono 2234238754 de la empresa Claro, consultad si posee sistema de rastreo, refiere que No recuerda, tambien tenia su Documento Nacional de Identidad, Licencia de Conducir, tarjeta de Credito Visa de Banco Provincia y debito de banco Provincia, tarjeta de Banco Frances Black no recuerda si es Visa o MasterCard, cedula del auto sustraido a nombre del dicente, una llave de un auto del dicente de marca Peugeot modelo 206.‚Äô‚Äô Preguntado si recuerda cuanto combustible tenia, refiere que tenia tanque completo. Consultado por si el vehiculo posee alguna caracteristica particular refiere que tiene un choque en el guardabarro posterior del lado del conductor, el dicente le coloco cinta aislante, vidrios naturales. Consultado para que manifieste cuantos juegos de llaves posee y si puede exhibir, refiere que tiene dos juegos de llaves, una la sustraida y la otra la tiene en su casa, no la exhibe. Preguntado poseia algun desperfecto mecanico, refiere que NO. Consultado si recuerda kilometraje, refiere que no recuerda. Consultado si posee sistema de rastreo satelital, refiere que ‚ÄúNO‚Äù. Preguntado si en el ultimo tiempo lo llevo a algun taller mecanico, manifiesta que ‚Äúque NO‚Äù. Preguntado si posee fotografias refiere que ‚Äò‚ÄòNO‚Äô‚Äô. Preguntado para que manifieste si sabe de la existencia de testigos refiere: ‚Äúque no habia nadie‚Äô‚Äô. Preguntado para que manifieste si en el lugar se emplazan camaras refiere que ‚Äò‚Äòun vecino le aporto las camaras de su vivineda‚Äô‚Äô. Consultado si sospecha de alguien, informa que ‚ÄúNO‚Äù. Preguntado para que manifieste si realizo cambios en la poliza de seguro refiere ‚Äò‚ÄòNO posee‚Äô‚Äô."                 </div>             </div>         </div>         </div>`)[0];
